Um die Position und Geschwindigkeit des Körpers simulieren zu können, muss also vorerst die, aus der Kraft resultierende Beschleunigung, unter Verwendung der folgenden Formeln berechnet werden. (die Formeln müssen nach \(a\) umgestellt werden und \(G = \gamma\)) \[ F = G \frac{m_1 m_2}{r^2} \] \[ F = m \cdot a \] Lösung \[ F = m_1 \cdot a \] Teilen durch \(m\) \[ a = \frac{F}{m_1} \] Einsetzen von \(F\) \[ a = \frac{G \frac{m_1 m_2}{r^2}}{m_1} \] Kürzen \[ a = G \frac{m_1 m_2}{m_1 r^2} \] \[ \underline{\underline{a = G \frac{m_2}{r^2}}} \] Die Gleichung kann wie folgt in Javascript implementiert werden: update(body: GravBody) { // Gravitationskonstante (fiktiver Wert) let G = 1; // Berechnen der Entfernung zwischen den Körpern let r = this.pos.distance(body.pos); // Richtung der Beschleunigung // (Vektor, welcher in Richtung des anderen Körpers zeigt) // // +--------------------> // | this other // | x------>x // | dir // | // V let dir = body.pos.sub(this.pos); // Betrag der Beschleunigung (ohne Richtung) let absAcc = G * (body.mass / (r*r)); // kombinieren von Richtung und Betrag der Beschleunigung let acc = dir.withLength(absAcc); this.vel = this.vel.add(acc); this.pos = this.pos.add(this.vel);
} Wenn die Gleichung korrekt implementiert wurde, sollte die Erde in der Simulation um die Sonne kreisen. Der Code der soweit fertigen Grundsimulation könnte wie folgt aussehen: // import des Layouts der Seite
import "./style.css";
// import von allen benötigten Funktionen
import { Vec2 } from "@david.harwardt/math";
import { Canvas2d, CanvasFullscreenPlugin, DrawLoop, CanvasDraggablePlugin, CanvasInputManagerPlugin,
} from "@david.harwardt/canvas-2d"; let canvas = Canvas2d.fromParent(document.body);
canvas.addPlugin(new CanvasFullscreenPlugin()); canvas.init(); let loop = new DrawLoop(draw);
loop.start(); class GravBody { pos: Vec2; vel: Vec2; mass: number; constructor(pos: Vec2, vel: Vec2, mass: number) { this.pos = pos; this.vel = vel; this.mass = mass; } draw(canvas: Canvas2d) { let radius = Math.sqrt(this.mass); canvas.drawCircle(this.pos, radius); } update(body: GravBody) { let G = 1; let r = this.pos.distance(body.pos); let dir = body.pos.sub(this.pos); let absAcc = G * (body.mass / (r*r)); let acc = dir.withLength(absAcc); this.vel = this.vel.add(acc); this.pos = this.pos.add(this.vel); } updateAll(bodies: GravBody[]) { }
} let sun = new GravBody(new Vec2(500, 500), new Vec2(0, 0), 1000);
let earth = new GravBody(new Vec2(500, 300), new Vec2(2, 0), 20); // Zeichenfunktion der Szene
function draw() { canvas.clear(); canvas.beginDraw(); earth.update(sun); earth.draw(canvas); sun.draw(canvas); canvas.endDraw();
} Alle weitern Schritte dienen der Erweiterung der, nun fertigen, Grundsimulation.

